import EndQuiz from '../EndQuiz/EndQuiz'
import { useState } from 'react'
let QuizWindow = () =>{
    let quizState,changeQuizState = useState(0);
    if(quizState==='0')
    {
        return(
        <div className={styles.QuizWindow}>
            <StartQuiz></StartQuiz>
        </div>
        )
    }
    if(quizState===1)
    {   return(
        <div className={styles.QuizWindow}>
        <PlayQuiz></PlayQuiz>
        </div>
    )
    } 
    else if(quizState===2)
    {
        return(        
        <div className={styles.QuizWindow}>
            <EndQuiz></EndQuiz>
        </div>)

    }
}

export default QuizWindow;
